const TodoList = () => {
    let [description, setDescription] = useState('');
    let [date, setDate] = useState('');
    let [time, setTime] = useState('');
    const btn_submit = (ev) => {
        ev.preventDefault();
    }
    return (
        <div>
            <div className="info-container" onSubmit={btn_submit}>
                <h3>Enter Information</h3>
                <form className="information">
                    <label>Description:</label><input type='text' onChange={(ev) => setDescription(ev.target.value)} /><br />
                    <label>Date:</label><input type='Date' onChange={(ev) => setDate(ev.target.value)} /><br />
                    <label>Time:</label><input type='Time' /><br />
                    <input type='submit' value='Add Item' />
                </form>
            </div>
            <div className="list-container">

            </div>
        </div>
    )
}
export default TodoList;
